import React from 'react';

var Ons = require('onsenui');
var ROns = require('react-onsenui');

class Main extends React.Component {
    constructor(props) {
        super(props);
      }
    

    handleClick() 
    {
      Ons.notification.alert('Hello world!');
    }
      
    render() {
        return (
        <ROns.Page>
            <ROns.Toolbar>
                <div class="center">
                    <ROns.ToolbarButton>
                        Menu
                    </ROns.ToolbarButton>
                </div>
            </ROns.Toolbar>
            <ROns.Button onClick={this.handleClick}>Tap me!</ROns.Button>
        </ROns.Page>
        );
    }
}

export default Main;
